Ad Text:
12 month contract
Python or R - AWS S3 - LLMs & Gen AI
ACT, NSW or VIC Address - Hybrid 3/2 dpw

Our client, a Commonwealth Government organisation whose focus is to provide support to Australian's living with disability, require the services of a AI Data Scientist.

Duties of the AI Data Scientist

Research & implement innovative techniques and interdisciplinary methods to solve business issues with a focus on application of AI/data science and statistical techniques;
Designing statistical, mathematical, & various data science models to conduct analytical work that addresses business issues, & development of new products;
Present outcomes of work undertaken, tailored to context & stakeholders;
Undertake ad hoc modelling & data science requests.

 Skills and Experience Required

4+ years of experience as a Data Scientist in either public or private sector;
Experience with complex internal or external stakeholder engagement & management;
Proficient Python or R programming skills including data manipulation, analysis & model development/deployment;
Demonstrated experience in application of Artificial Intelligence & Data Science techniques & processes;
A growth mindset & demonstrated initiative in exploring, learning, & applying new data science techniques & processes to improve DaSH capabilities & project outcomes;
Proficient in SQL, accessing databases & data storage systems (e.g AWS S3) (desired);
Working knowledge of Language Models, Large Language Models & Generative AI & how they can be used effectively (desired);
Working knowledge & understanding of AI Assurance & Governance frameworks relating to the development of ethically sound & safe AI systems (desired).

